searchIndex["stable_deref_trait"] = {"doc":"This module defines an unsafe marker trait, StableDeref, for container types that deref to a fixed address which is valid even when the containing type is moved. For example, Box, Vec, Rc, Arc and String implement this trait. Additionally, it defines CloneStableDeref for types like Rc where clones deref to the same address.","items":[[8,"StableDeref","stable_deref_trait","An unsafe marker trait for types that deref to a stable address, even when moved. For example, this is implemented by Box, Vec, Rc, Arc and String, among others. Even when a Box is moved, the underlying storage remains at a fixed location.",null,null],[8,"CloneStableDeref","","An unsafe marker trait for types where clones deref to the same address. This has all the requirements of StableDeref, and additionally requires that after calling clone(), both the old and new value deref to the same address. For example, Rc and Arc implement CloneStableDeref, but Box and Vec do not.",null,null]],"paths":[]};
searchIndex["strsim"] = {"doc":"This library implements string similarity metrics.","items":[[4,"StrSimError","strsim","",null,null],[13,"DifferentLengthArgs","","",0,null],[5,"hamming","","Calculates the number of positions in the two strings where the characters differ. Returns an error if the strings have different lengths.",null,{"i":[{"n":"str"},{"n":"str"}],"o":{"n":"hammingresult"}}],[5,"jaro","","Calculates the Jaro similarity between two strings. The returned value is between 0.0 and 1.0 (higher value means more similar).",null,{"i":[{"n":"str"},{"n":"str"}],"o":{"n":"f64"}}],[5,"jaro_winkler","","Like Jaro but gives a boost to strings that have a common prefix.",null,{"i":[{"n":"str"},{"n":"str"}],"o":{"n":"f64"}}],[5,"levenshtein","","Calculates the minimum number of insertions, deletions, and substitutions required to change one string into the other.",null,{"i":[{"n":"str"},{"n":"str"}],"o":{"n":"usize"}}],[5,"osa_distance","","Like Levenshtein but allows for adjacent transpositions. Each substring can only be edited once.",null,{"i":[{"n":"str"},{"n":"str"}],"o":{"n":"usize"}}],[5,"damerau_levenshtein","","Like optimal string alignment, but substrings can be edited an unlimited number of times, and the triangle inequality holds.",null,{"i":[{"n":"str"},{"n":"str"}],"o":{"n":"usize"}}],[6,"HammingResult","","",null,null],[11,"fmt","","",0,{"i":[{"n":"self"},{"n":"formatter"}],"o":{"n":"result"}}],[11,"eq","","",0,{"i":[{"n":"self"},{"n":"strsimerror"}],"o":{"n":"bool"}}]],"paths":[[4,"StrSimError"]]};
searchIndex["structopt"] = {"doc":"This crate defines the `StructOpt` trait and its custom derrive.","items":[[0,"clap","structopt","Re-export of clap",null,null],[3,"App","structopt::clap","Used to create a representation of a command line program and all possible command line arguments. Application settings are set using the \"builder pattern\" with the [`App::get_matches`] family of methods being the terminal methods that starts the runtime-parsing process. These methods then return information about the user supplied arguments (or lack there of).",null,null],[4,"ArgSettings","","Various settings that apply to arguments and may be set, unset, and checked via getter/setter methods [`Arg::set`], [`Arg::unset`], and [`Arg::is_set`]",null,null],[13,"Required","","The argument must be used",0,null],[13,"Multiple","","The argument may be used multiple times such as `--flag --flag`",0,null],[13,"EmptyValues","","The argument allows empty values such as `--option \"\"`",0,null],[13,"Global","","The argument should be propagated down through all child [`SubCommands`] [`SubCommand`]: ./struct.SubCommand.html",0,null],[13,"Hidden","","The argument should not be shown in help text",0,null],[13,"TakesValue","","The argument accepts a value, such as `--option <value>`",0,null],[13,"UseValueDelimiter","","Determines if the argument allows values to be grouped via a delimiter",0,null],[13,"NextLineHelp","","Prints the help text on the line after the argument",0,null],[13,"RequireDelimiter","","Requires the use of a value delimiter for all multiple values",0,null],[13,"HidePossibleValues","","Hides the possible values from the help string",0,null],[13,"AllowLeadingHyphen","","Allows vals that start with a '-'",0,null],[13,"RequireEquals","","Require options use `--option=val` syntax",0,null],[13,"Last","","Specifies that the arg is the last positional argument and may be accessed early via `--` syntax",0,null],[13,"HideDefaultValue","","Hides the default value from the help string",0,null],[13,"CaseInsensitive","","Makes `Arg::possible_values` case insensitive",0,null],[13,"HideEnvValues","","Hides ENV values in the help message",0,null],[13,"HiddenShortHelp","","The argument should not be shown in short help text",0,null],[13,"HiddenLongHelp","","The argument should not be shown in long help text",0,null],[3,"Arg","","The abstract representation of a command line argument. Used to set all the options and relationships that define a valid argument for the program.",null,null],[6,"Result","","Short hand for [`Result`] type",null,null],[3,"Values","","An iterator for getting multiple values out of an argument via the [`ArgMatches::values_of`] method.",null,null],[4,"ErrorKind","","Command line argument parser kind of error",null,null],[13,"InvalidValue","","Occurs when an [`Arg`] has a set of possible values, and the user provides a value which isn't in that set.",1,null],[13,"UnknownArgument","","Occurs when a user provides a flag, option, argument or subcommand which isn't defined.",1,null],[13,"InvalidSubcommand","","Occurs when the user provides an unrecognized [`SubCommand`] which meets the threshold for being similar enough to an existing subcommand. If it doesn't meet the threshold, or the 'suggestions' feature is disabled, the more general [`UnknownArgument`] error is returned.",1,null],[13,"UnrecognizedSubcommand","","Occurs when the user provides an unrecognized [`SubCommand`] which either doesn't meet the threshold for being similar enough to an existing subcommand, or the 'suggestions' feature is disabled. Otherwise the more detailed [`InvalidSubcommand`] error is returned.",1,null],[13,"EmptyValue","","Occurs when the user provides an empty value for an option that does not allow empty values.",1,null],[13,"ValueValidation","","Occurs when the user provides a value for an argument with a custom validation and the value fails that validation.",1,null],[13,"TooManyValues","","Occurs when a user provides more values for an argument than were defined by setting [`Arg::max_values`].",1,null],[13,"TooFewValues","","Occurs when the user provides fewer values for an argument than were defined by setting [`Arg::min_values`].",1,null],[13,"WrongNumberOfValues","","Occurs when the user provides a different number of values for an argument than what's been defined by setting [`Arg::number_of_values`] or than was implicitly set by [`Arg::value_names`].",1,null],[13,"ArgumentConflict","","Occurs when the user provides two values which conflict with each other and can't be used together.",1,null],[13,"MissingRequiredArgument","","Occurs when the user does not provide one or more required arguments.",1,null],[13,"MissingSubcommand","","Occurs when a subcommand is required (as defined by [`AppSettings::SubcommandRequired`]), but the user does not provide one.",1,null],[13,"MissingArgumentOrSubcommand","","Occurs when either an argument or [`SubCommand`] is required, as defined by [`AppSettings::ArgRequiredElseHelp`], but the user did not provide one.",1,null],[13,"UnexpectedMultipleUsage","","Occurs when the user provides multiple values to an argument which doesn't allow that.",1,null],[13,"InvalidUtf8","","Occurs when the user provides a value containing invalid UTF-8 for an argument and [`AppSettings::StrictUtf8`] is set.",1,null],[13,"HelpDisplayed","","Not a true \"error\" as it means `--help` or similar was used. The help message will be sent to `stdout`.",1,null],[13,"VersionDisplayed","","Not a true \"error\" as it means `--version` or similar was used. The message will be sent to `stdout`.",1,null],[13,"ArgumentNotFound","","Occurs when using the [`value_t!`] and [`values_t!`] macros to convert an argument value into type `T`, but the argument you requested wasn't used. I.e. you asked for an argument with name `config` to be converted, but `config` wasn't used by the user. [`value_t!`]: ./macro.value_t!.html [`values_t!`]: ./macro.values_t!.html",1,null],[13,"Io","","Represents an [I/O error]. Can occur when writing to `stderr` or `stdout` or reading a configuration file. [I/O error]: https://doc.rust-lang.org/std/io/struct.Error.html",1,null],[13,"Format","","Represents a [Format error] (which is a part of [`Display`]). Typically caused by writing to `stderr` or `stdout`. [`Display`]: https://doc.rust-lang.org/std/fmt/trait.Display.html [Format error]: https://doc.rust-lang.org/std/fmt/struct.Error.html",1,null],[3,"ArgMatches","","Used to get information about the arguments that where supplied to the program at runtime by the user. New instances of this struct are obtained by using the [`App::get_matches`] family of methods.",null,null],[4,"AppSettings","","Application level settings, which affect how [`App`] operates",null,null],[13,"AllowInvalidUtf8","","Specifies that any invalid UTF-8 code points should not be treated as an error. This is the default behavior of `clap`.",2,null],[13,"AllArgsOverrideSelf","","Essentially sets [`Arg::overrides_with(\"itself\")`] for all arguments.",2,null],[13,"AllowLeadingHyphen","","Specifies that leading hyphens are allowed in argument values, such as negative numbers like `-10`. (which would otherwise be parsed as another flag or option)",2,null],[13,"AllowNegativeNumbers","","Allows negative numbers to pass as values. This is similar to `AllowLeadingHyphen` except that it only allows numbers, all other undefined leading hyphens will fail to parse.",2,null],[13,"AllowMissingPositional","","Allows one to implement two styles of CLIs where positionals can be used out of order.",2,null],[13,"AllowExternalSubcommands","","Specifies that an unexpected positional argument, which would otherwise cause a [`ErrorKind::UnknownArgument`] error, should instead be treated as a [`SubCommand`] within the [`ArgMatches`] struct.",2,null],[13,"ArgsNegateSubcommands","","Specifies that use of a valid [argument] negates [subcommands] being used after. By default `clap` allows arguments between subcommands such as `<cmd> [cmd_args] <cmd2> [cmd2_args] <cmd3> [cmd3_args]`. This setting disables that functionality and says that arguments can only follow the final subcommand. For instance using this setting makes only the following invocations possible:",2,null],[13,"ArgRequiredElseHelp","","Specifies that the help text should be displayed (and then exit gracefully), if no arguments are present at runtime (i.e. an empty run such as, `$ myprog`.",2,null],[13,"ColoredHelp","","Uses colorized help messages.",2,null],[13,"ColorAuto","","Enables colored output only when the output is going to a terminal or TTY.",2,null],[13,"ColorAlways","","Enables colored output regardless of whether or not the output is going to a terminal/TTY.",2,null],[13,"ColorNever","","Disables colored output no matter if the output is going to a terminal/TTY, or not.",2,null],[13,"DontCollapseArgsInUsage","","Disables the automatic collapsing of positional args into `[ARGS]` inside the usage string",2,null],[13,"DontDelimitTrailingValues","","Disables the automatic delimiting of values when `--` or [`AppSettings::TrailingVarArg`] was used.",2,null],[13,"DisableHelpSubcommand","","Disables the `help` subcommand",2,null],[13,"DisableVersion","","Disables `-V` and `--version` [`App`] without affecting any of the [`SubCommand`]s (Defaults to `false`; application does have a version flag)",2,null],[13,"DeriveDisplayOrder","","Displays the arguments and [`SubCommand`]s in the help message in the order that they were declared in, and not alphabetically which is the default.",2,null],[13,"GlobalVersion","","Specifies to use the version of the current command for all child [`SubCommand`]s. (Defaults to `false`; subcommands have independent version strings from their parents.)",2,null],[13,"Hidden","","Specifies that this [`SubCommand`] should be hidden from help messages",2,null],[13,"HidePossibleValuesInHelp","","Tells `clap` not to print possible values when displaying help information. This can be useful if there are many values, or they are explained elsewhere.",2,null],[13,"InferSubcommands","","Tries to match unknown args to partial [`subcommands`] or their [aliases]. For example to match a subcommand named `test`, one could use `t`, `te`, `tes`, and `test`.",2,null],[13,"NoBinaryName","","Specifies that the parser should not assume the first argument passed is the binary name. This is normally the case when using a \"daemon\" style mode, or an interactive CLI where one one would not normally type the binary or program name for each command.",2,null],[13,"NextLineHelp","","Places the help string for all arguments on the line after the argument.",2,null],[13,"PropagateGlobalValuesDown","","DEPRECATED: This setting is no longer required in order to propagate values up or down",2,null],[13,"SubcommandsNegateReqs","","Allows [`SubCommand`]s to override all requirements of the parent command. For example if you had a subcommand or top level application with a required argument that is only required as long as there is no subcommand present, using this setting would allow you to set those arguments to [`Arg::required(true)`] and yet receive no error so long as the user uses a valid subcommand instead.",2,null],[13,"SubcommandRequiredElseHelp","","Specifies that the help text should be displayed (before exiting gracefully) if no [`SubCommand`]s are present at runtime (i.e. an empty run such as `$ myprog`).",2,null],[13,"StrictUtf8","","Specifies that any invalid UTF-8 code points should be treated as an error and fail with a [`ErrorKind::InvalidUtf8`] error.",2,null],[13,"SubcommandRequired","","Allows specifying that if no [`SubCommand`] is present at runtime, error and exit gracefully.",2,null],[13,"TrailingVarArg","","Specifies that the final positional argument is a \"VarArg\" and that `clap` should not attempt to parse any further args.",2,null],[13,"UnifiedHelpMessage","","Groups flags and options together, presenting a more unified help message (a la `getopts` or `docopt` style).",2,null],[13,"VersionlessSubcommands","","Disables `-V` and `--version` for all [`SubCommand`]s (Defaults to `false`; subcommands do have version flags.)",2,null],[13,"WaitOnError","","Will display a message \"Press [ENTER]/[RETURN] to continue...\" and wait for user before exiting",2,null],[3,"ArgGroup","","`ArgGroup`s are a family of related [arguments] and way for you to express, \"Any of these arguments\". By placing arguments in a logical group, you can create easier requirement and exclusion rules instead of having to list each argument individually, or when you want a rule to apply \"any but not all\" arguments.",null,null],[3,"Error","","Command Line Argument Parser Error",null,null],[12,"message","","Formatted error message",3,null],[12,"kind","","The type of error",3,null],[12,"info","","Any additional information passed along, such as the argument name that caused the error",3,null],[3,"SubCommand","","The abstract representation of a command line subcommand.",null,null],[4,"Shell","","Describes which shell to produce a completions file for",null,null],[13,"Bash","","Generates a .bash completion file for the Bourne Again SHell (BASH)",4,null],[13,"Fish","","Generates a .fish completion file for the Friendly Interactive SHell (fish)",4,null],[13,"Zsh","","Generates a completion file for the Z SHell (ZSH)",4,null],[13,"PowerShell","","Generates a completion file for PowerShell",4,null],[13,"Elvish","","Generates a completion file for Elvish",4,null],[3,"OsValues","","An iterator for getting multiple values out of an argument via the [`ArgMatches::values_of_os`] method. Usage of this iterator allows values which contain invalid UTF-8 code points unlike [`Values`].",null,null],[14,"crate_description","","Allows you to pull the description from your Cargo.toml at compile time.",null,null],[14,"value_t","","Convenience macro getting a typed value `T` where `T` implements [`std::str::FromStr`] from an argument value. This macro returns a `Result<T,String>` which allows you as the developer to decide what you'd like to do on a failed parse. There are two types of errors, parse failures and those where the argument wasn't present (such as a non-required argument). You can use it to get a single value, or a iterator as with the [`ArgMatches::values_of`]",null,null],[14,"_clap_count_exprs","","Counts the number of comma-delimited expressions passed to it.  The result is a compile-time evaluable expression, suitable for use as a static array size, or the value of a `const`.",null,null],[14,"clap_app","","Build `App`, `Arg`s, `SubCommand`s and `Group`s with Usage-string like input but without the associated parsing runtime cost.",null,null],[14,"crate_version","","Allows you to pull the version from your Cargo.toml at compile time as `MAJOR.MINOR.PATCH_PKGVERSION_PRE`",null,null],[14,"value_t_or_exit","","Convenience macro getting a typed value `T` where `T` implements [`std::str::FromStr`] or exiting upon error, instead of returning a [`Result`] type.",null,null],[14,"values_t_or_exit","","Convenience macro getting a typed value [`Vec<T>`] where `T` implements [`std::str::FromStr`] or exiting upon error.",null,null],[14,"arg_enum","","Convenience macro to generate more complete enums with variants to be used as a type when parsing arguments. This enum also provides a `variants()` function which can be used to retrieve a `Vec<&'static str>` of the variant names, as well as implementing [`FromStr`] and [`Display`] automatically.",null,null],[14,"app_from_crate","","Allows you to build the `App` instance from your Cargo.toml at compile time.",null,null],[14,"crate_authors","","Allows you to pull the authors for the app from your Cargo.toml at compile time in the form: `\"author1 lastname <author1@example.com>:author2 lastname <author2@example.com>\"`",null,null],[14,"crate_name","","Allows you to pull the name from your Cargo.toml at compile time.",null,null],[14,"values_t","","Convenience macro getting a typed value [`Vec<T>`] where `T` implements [`std::str::FromStr`] This macro returns a [`clap::Result<Vec<T>>`] which allows you as the developer to decide what you'd like to do on a failed parse.",null,null],[8,"StructOpt","structopt","A struct that is converted from command line arguments.",null,null],[10,"clap","","Returns the corresponding `clap::App`.",5,{"o":{"n":"app"}}],[10,"from_clap","","Creates the struct from `clap::ArgMatches`.  It cannot fail with a parameter generated by `clap` by construction.",5,{"i":[{"n":"argmatches"}],"o":{"n":"self"}}],[11,"from_args","","Gets the struct from the command line arguments.  Print the error message and quit the program in case of failure.",5,{"o":{"n":"self"}}],[11,"from_iter","","Gets the struct from any iterator such as a `Vec` of your making. Print the error message and quit the program in case of failure.",5,{"i":[{"n":"i"}],"o":{"n":"self"}}],[11,"from_iter_safe","","Gets the struct from any iterator such as a `Vec` of your making.",5,{"i":[{"n":"i"}],"o":{"g":["error"],"n":"result"}}],[11,"new","structopt::clap","Creates a new instance of an application requiring a name. The name may be, but doesn't have to be same as the binary. The name will be displayed to the user when they request to print version or help and usage information.",6,{"i":[{"n":"s"}],"o":{"n":"app"}}],[11,"get_name","","Get the name of the app",6,{"i":[{"n":"self"}],"o":{"n":"str"}}],[11,"get_bin_name","","Get the name of the binary",6,{"i":[{"n":"self"}],"o":{"g":["str"],"n":"option"}}],[11,"with_defaults","","Creates a new instance of an application requiring a name, but uses the [`crate_authors!`] and [`crate_version!`] macros to fill in the [`App::author`] and [`App::version`] fields.",6,{"i":[{"n":"s"}],"o":{"n":"app"}}],[11,"author","","Sets a string of author(s) that will be displayed to the user when they request the help information with `--help` or `-h`.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"bin_name","","Overrides the system-determined binary name. This should only be used when absolutely necessary, such as when the binary name for your application is misleading, or perhaps not how the user should invoke your program.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"about","","Sets a string describing what the program does. This will be displayed when displaying help information with `-h`.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"long_about","","Sets a string describing what the program does. This will be displayed when displaying help information.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"name","","Sets the program's name. This will be displayed when displaying help information.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"after_help","","Adds additional help information to be displayed in addition to auto-generated help. This information is displayed after the auto-generated help information. This is often used to describe how to use the arguments, or caveats to be noted.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"before_help","","Adds additional help information to be displayed in addition to auto-generated help. This information is displayed before the auto-generated help information. This is often used for header information.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"version","","Sets a string of the version number to be displayed when displaying version or help information with `-V`.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"long_version","","Sets a string of the version number to be displayed when displaying version or help information with `--version`.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"usage","","Sets a custom usage string to override the auto-generated usage string.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"help","","Sets a custom help message and overrides the auto-generated one. This should only be used when the auto-generated message does not suffice.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"help_short","","Sets the [`short`] for the auto-generated `help` argument.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"version_short","","Sets the [`short`] for the auto-generated `version` argument.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"help_message","","Sets the help text for the auto-generated `help` argument.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"version_message","","Sets the help text for the auto-generated `version` argument.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"template","","Sets the help template to be used, overriding the default format.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"setting","","Enables a single command, or [`SubCommand`], level settings.",6,{"i":[{"n":"self"},{"n":"appsettings"}],"o":{"n":"app"}}],[11,"settings","","Enables multiple command, or [`SubCommand`], level settings",6,null],[11,"global_setting","","Enables a single setting that is propagated down through all child [`SubCommand`]s.",6,{"i":[{"n":"self"},{"n":"appsettings"}],"o":{"n":"app"}}],[11,"global_settings","","Enables multiple settings which are propagated down through all child [`SubCommand`]s.",6,null],[11,"unset_setting","","Disables a single command, or [`SubCommand`], level setting.",6,{"i":[{"n":"self"},{"n":"appsettings"}],"o":{"n":"app"}}],[11,"unset_settings","","Disables multiple command, or [`SubCommand`], level settings.",6,null],[11,"set_term_width","","Sets the terminal width at which to wrap help messages. Defaults to `120`. Using `0` will ignore terminal widths and use source formatting.",6,{"i":[{"n":"self"},{"n":"usize"}],"o":{"n":"app"}}],[11,"max_term_width","","Sets the max terminal width at which to wrap help messages. Using `0` will ignore terminal widths and use source formatting.",6,{"i":[{"n":"self"},{"n":"usize"}],"o":{"n":"app"}}],[11,"arg","","Adds an [argument] to the list of valid possibilities.",6,{"i":[{"n":"self"},{"n":"a"}],"o":{"n":"app"}}],[11,"args","","Adds multiple [arguments] to the list of valid possibilities",6,null],[11,"arg_from_usage","","A convenience method for adding a single [argument] from a usage type string. The string used follows the same rules and syntax as [`Arg::from_usage`]",6,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"app"}}],[11,"args_from_usage","","Adds multiple [arguments] at once from a usage string, one per line. See [`Arg::from_usage`] for details on the syntax and rules supported.",6,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"app"}}],[11,"alias","","Allows adding a [`SubCommand`] alias, which function as \"hidden\" subcommands that automatically dispatch as if this subcommand was used. This is more efficient, and easier than creating multiple hidden subcommands as one only needs to check for the existence of this command, and not all variants.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"aliases","","Allows adding [`SubCommand`] aliases, which function as \"hidden\" subcommands that automatically dispatch as if this subcommand was used. This is more efficient, and easier than creating multiple hidden subcommands as one only needs to check for the existence of this command, and not all variants.",6,null],[11,"visible_alias","","Allows adding a [`SubCommand`] alias that functions exactly like those defined with [`App::alias`], except that they are visible inside the help message.",6,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"app"}}],[11,"visible_aliases","","Allows adding multiple [`SubCommand`] aliases that functions exactly like those defined with [`App::aliases`], except that they are visible inside the help message.",6,null],[11,"group","","Adds an [`ArgGroup`] to the application. [`ArgGroup`]s are a family of related arguments. By placing them in a logical group, you can build easier requirement and exclusion rules. For instance, you can make an entire [`ArgGroup`] required, meaning that one (and only one) argument from that group must be present at runtime.",6,{"i":[{"n":"self"},{"n":"arggroup"}],"o":{"n":"app"}}],[11,"groups","","Adds multiple [`ArgGroup`]s to the [`App`] at once.",6,null],[11,"subcommand","","Adds a [`SubCommand`] to the list of valid possibilities. Subcommands are effectively sub-[`App`]s, because they can contain their own arguments, subcommands, version, usage, etc. They also function just like [`App`]s, in that they get their own auto generated help, version, and usage.",6,{"i":[{"n":"self"},{"n":"app"}],"o":{"n":"app"}}],[11,"subcommands","","Adds multiple subcommands to the list of valid possibilities by iterating over an [`IntoIterator`] of [`SubCommand`]s",6,{"i":[{"n":"self"},{"n":"i"}],"o":{"n":"app"}}],[11,"display_order","","Allows custom ordering of [`SubCommand`]s within the help message. Subcommands with a lower value will be displayed first in the help message. This is helpful when one would like to emphasise frequently used subcommands, or prioritize those towards the top of the list. Duplicate values are allowed. Subcommands with duplicate display orders will be displayed in alphabetical order.",6,{"i":[{"n":"self"},{"n":"usize"}],"o":{"n":"app"}}],[11,"print_help","","Prints the full help message to [`io::stdout()`] using a [`BufWriter`] using the same method as if someone ran `-h` to request the help message",6,{"i":[{"n":"self"}],"o":{"g":["error"],"n":"result"}}],[11,"print_long_help","","Prints the full help message to [`io::stdout()`] using a [`BufWriter`] using the same method as if someone ran `--help` to request the help message",6,{"i":[{"n":"self"}],"o":{"g":["error"],"n":"result"}}],[11,"write_help","","Writes the full help message to the user to a [`io::Write`] object in the same method as if the user ran `-h`",6,{"i":[{"n":"self"},{"n":"w"}],"o":{"g":["error"],"n":"result"}}],[11,"write_long_help","","Writes the full help message to the user to a [`io::Write`] object in the same method as if the user ran `--help`",6,{"i":[{"n":"self"},{"n":"w"}],"o":{"g":["error"],"n":"result"}}],[11,"write_version","","Writes the version message to the user to a [`io::Write`] object as if the user ran `-V`.",6,{"i":[{"n":"self"},{"n":"w"}],"o":{"g":["error"],"n":"result"}}],[11,"write_long_version","","Writes the version message to the user to a [`io::Write`] object",6,{"i":[{"n":"self"},{"n":"w"}],"o":{"g":["error"],"n":"result"}}],[11,"gen_completions","","Generate a completions file for a specified shell at compile time.",6,null],[11,"gen_completions_to","","Generate a completions file for a specified shell at runtime.  Until `cargo install` can install extra files like a completion script, this may be used e.g. in a command that outputs the contents of the completion script, to be redirected into a file by the user.",6,null],[11,"get_matches","","Starts the parsing process, upon a failed parse an error will be displayed to the user and the process will exit with the appropriate error code. By default this method gets all user provided arguments from [`env::args_os`] in order to allow for invalid UTF-8 code points, which are legal on many platforms.",6,{"i":[{"n":"self"}],"o":{"n":"argmatches"}}],[11,"get_matches_safe","","Starts the parsing process. This method will return a [`clap::Result`] type instead of exiting the process on failed parse. By default this method gets matches from [`env::args_os`]",6,{"i":[{"n":"self"}],"o":{"g":["argmatches","error"],"n":"result"}}],[11,"get_matches_from","","Starts the parsing process. Like [`App::get_matches`] this method does not return a [`clap::Result`] and will automatically exit with an error message. This method, however, lets you specify what iterator to use when performing matches, such as a [`Vec`] of your making.",6,{"i":[{"n":"self"},{"n":"i"}],"o":{"n":"argmatches"}}],[11,"get_matches_from_safe","","Starts the parsing process. A combination of [`App::get_matches_from`], and [`App::get_matches_safe`]",6,{"i":[{"n":"self"},{"n":"i"}],"o":{"g":["argmatches","error"],"n":"result"}}],[11,"get_matches_from_safe_borrow","","Starts the parsing process without consuming the [`App`] struct `self`. This is normally not the desired functionality, instead prefer [`App::get_matches_from_safe`] which does consume `self`.",6,{"i":[{"n":"self"},{"n":"i"}],"o":{"g":["argmatches","error"],"n":"result"}}],[11,"from","","",3,{"i":[{"n":"error"}],"o":{"n":"error"}}],[11,"from","","",7,{"i":[{"n":"arg"}],"o":{"n":"arg"}}],[11,"from","","",3,{"i":[{"n":"error"}],"o":{"n":"error"}}],[11,"from","","",8,{"i":[{"n":"arggroup"}],"o":{"n":"arggroup"}}],[11,"fmt","","",3,{"i":[{"n":"self"},{"n":"formatter"}],"o":{"g":["error"],"n":"result"}}],[11,"fmt","","",4,{"i":[{"n":"self"},{"n":"formatter"}],"o":{"g":["error"],"n":"result"}}],[11,"fmt","","",6,{"i":[{"n":"self"},{"n":"formatter"}],"o":{"g":["error"],"n":"result"}}],[11,"eq","","",7,{"i":[{"n":"self"},{"n":"arg"}],"o":{"n":"bool"}}],[11,"eq","","",2,{"i":[{"n":"self"},{"n":"appsettings"}],"o":{"n":"bool"}}],[11,"eq","","",0,{"i":[{"n":"self"},{"n":"argsettings"}],"o":{"n":"bool"}}],[11,"eq","","",1,{"i":[{"n":"self"},{"n":"errorkind"}],"o":{"n":"bool"}}],[11,"next_back","","",9,{"i":[{"n":"self"}],"o":{"g":["osstr"],"n":"option"}}],[11,"next_back","","",10,{"i":[{"n":"self"}],"o":{"g":["str"],"n":"option"}}],[11,"clone","","",4,{"i":[{"n":"self"}],"o":{"n":"shell"}}],[11,"clone","","",1,{"i":[{"n":"self"}],"o":{"n":"errorkind"}}],[11,"clone","","",11,{"i":[{"n":"self"}],"o":{"n":"subcommand"}}],[11,"clone","","",8,{"i":[{"n":"self"}],"o":{"n":"arggroup"}}],[11,"clone","","",6,{"i":[{"n":"self"}],"o":{"n":"app"}}],[11,"clone","","",9,{"i":[{"n":"self"}],"o":{"n":"osvalues"}}],[11,"clone","","",0,{"i":[{"n":"self"}],"o":{"n":"argsettings"}}],[11,"clone","","",10,{"i":[{"n":"self"}],"o":{"n":"values"}}],[11,"clone","","",2,{"i":[{"n":"self"}],"o":{"n":"appsettings"}}],[11,"clone","","",12,{"i":[{"n":"self"}],"o":{"n":"argmatches"}}],[11,"clone","","",7,{"i":[{"n":"self"}],"o":{"n":"arg"}}],[11,"description","","",3,{"i":[{"n":"self"}],"o":{"n":"str"}}],[11,"from_str","","",2,{"i":[{"n":"str"}],"o":{"g":["appsettings"],"n":"result"}}],[11,"from_str","","",4,{"i":[{"n":"str"}],"o":{"g":["shell"],"n":"result"}}],[11,"from_str","","",0,{"i":[{"n":"str"}],"o":{"g":["argsettings"],"n":"result"}}],[11,"default","","",12,{"o":{"n":"argmatches"}}],[11,"default","","",9,{"o":{"n":"osvalues"}}],[11,"default","","",8,{"o":{"n":"arggroup"}}],[11,"default","","",10,{"o":{"n":"values"}}],[11,"default","","",7,{"o":{"n":"arg"}}],[11,"next","","",9,{"i":[{"n":"self"}],"o":{"g":["osstr"],"n":"option"}}],[11,"size_hint","","",9,null],[11,"next","","",10,{"i":[{"n":"self"}],"o":{"g":["str"],"n":"option"}}],[11,"size_hint","","",10,null],[11,"fmt","","",11,{"i":[{"n":"self"},{"n":"formatter"}],"o":{"g":["error"],"n":"result"}}],[11,"fmt","","",12,{"i":[{"n":"self"},{"n":"formatter"}],"o":{"g":["error"],"n":"result"}}],[11,"fmt","","",3,{"i":[{"n":"self"},{"n":"formatter"}],"o":{"g":["error"],"n":"result"}}],[11,"fmt","","",0,{"i":[{"n":"self"},{"n":"formatter"}],"o":{"g":["error"],"n":"result"}}],[11,"fmt","","",8,{"i":[{"n":"self"},{"n":"formatter"}],"o":{"g":["error"],"n":"result"}}],[11,"fmt","","",1,{"i":[{"n":"self"},{"n":"formatter"}],"o":{"g":["error"],"n":"result"}}],[11,"fmt","","",4,{"i":[{"n":"self"},{"n":"formatter"}],"o":{"g":["error"],"n":"result"}}],[11,"fmt","","",2,{"i":[{"n":"self"},{"n":"formatter"}],"o":{"g":["error"],"n":"result"}}],[11,"with_name","","Creates a new instance of [`Arg`] using a unique string name. The name will be used to get information about whether or not the argument was used at runtime, get values, set relationships with other args, etc..",7,{"i":[{"n":"str"}],"o":{"n":"arg"}}],[11,"from_usage","","Creates a new instance of [`Arg`] from a usage string. Allows creation of basic settings for the [`Arg`]. The syntax is flexible, but there are some rules to follow.",7,{"i":[{"n":"str"}],"o":{"n":"arg"}}],[11,"short","","Sets the short version of the argument without the preceding `-`.",7,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"arg"}}],[11,"long","","Sets the long version of the argument without the preceding `--`.",7,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"arg"}}],[11,"alias","","Allows adding a [`Arg`] alias, which function as \"hidden\" arguments that automatically dispatch as if this argument was used. This is more efficient, and easier than creating multiple hidden arguments as one only needs to check for the existence of this command, and not all variants.",7,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"arg"}}],[11,"aliases","","Allows adding [`Arg`] aliases, which function as \"hidden\" arguments that automatically dispatch as if this argument was used. This is more efficient, and easier than creating multiple hidden subcommands as one only needs to check for the existence of this command, and not all variants.",7,null],[11,"visible_alias","","Allows adding a [`Arg`] alias that functions exactly like those defined with [`Arg::alias`], except that they are visible inside the help message.",7,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"arg"}}],[11,"visible_aliases","","Allows adding multiple [`Arg`] aliases that functions exactly like those defined with [`Arg::aliases`], except that they are visible inside the help message.",7,null],[11,"help","","Sets the short help text of the argument that will be displayed to the user when they print the help information with `-h`. Typically, this is a short (one line) description of the arg.",7,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"arg"}}],[11,"long_help","","Sets the long help text of the argument that will be displayed to the user when they print the help information with `--help`. Typically this a more detailed (multi-line) message that describes the arg.",7,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"arg"}}],[11,"last","","Specifies that this arg is the last, or final, positional argument (i.e. has the highest index) and is only able to be accessed via the `--` syntax (i.e. `$ prog args -- last_arg`). Even, if no other arguments are left to parse, if the user omits the `--` syntax they will receive an [`UnknownArgument`] error. Setting an argument to `.last(true)` also allows one to access this arg early using the `--` syntax. Accessing an arg early, even with the `--` syntax is otherwise not possible.",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"required","","Sets whether or not the argument is required by default. Required by default means it is required, when no other conflicting rules have been evaluated. Conflicting rules take precedence over being required. Default: `false`",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"require_equals","","Requires that options use the `--option=val` syntax (i.e. an equals between the option and associated value) Default: `false`",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"allow_hyphen_values","","Allows values which start with a leading hyphen (`-`)",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"required_unless","","Sets an arg that override this arg's required setting. (i.e. this arg will be required unless this other argument is present).",7,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"arg"}}],[11,"required_unless_all","","Sets args that override this arg's required setting. (i.e. this arg will be required unless all these other arguments are present).",7,null],[11,"required_unless_one","","Sets args that override this arg's [required] setting. (i.e. this arg will be required unless at least one of these other arguments are present).",7,null],[11,"conflicts_with","","Sets a conflicting argument by name. I.e. when using this argument, the following argument can't be present and vice versa.",7,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"arg"}}],[11,"conflicts_with_all","","The same as [`Arg::conflicts_with`] but allows specifying multiple two-way conlicts per argument.",7,null],[11,"overrides_with","","Sets a overridable argument by name. I.e. this argument and the following argument will override each other in POSIX style (whichever argument was specified at runtime last \"wins\")",7,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"arg"}}],[11,"overrides_with_all","","Sets multiple mutually overridable arguments by name. I.e. this argument and the following argument will override each other in POSIX style (whichever argument was specified at runtime last \"wins\")",7,null],[11,"requires","","Sets an argument by name that is required when this one is present I.e. when using this argument, the following argument must be present.",7,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"arg"}}],[11,"requires_if","","Allows a conditional requirement. The requirement will only become valid if this arg's value equals `val`.",7,{"i":[{"n":"self"},{"n":"str"},{"n":"str"}],"o":{"n":"arg"}}],[11,"requires_ifs","","Allows multiple conditional requirements. The requirement will only become valid if this arg's value equals `val`.",7,null],[11,"required_if","","Allows specifying that an argument is [required] conditionally. The requirement will only become valid if the specified `arg`'s value equals `val`.",7,{"i":[{"n":"self"},{"n":"str"},{"n":"str"}],"o":{"n":"arg"}}],[11,"required_ifs","","Allows specifying that an argument is [required] based on multiple conditions. The conditions are set up in a `(arg, val)` style tuple. The requirement will only become valid if one of the specified `arg`'s value equals it's corresponding `val`.",7,null],[11,"requires_all","","Sets multiple arguments by names that are required when this one is present I.e. when using this argument, the following arguments must be present.",7,null],[11,"takes_value","","Specifies that the argument takes a value at run time.",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"hide_possible_values","","Specifies if the possible values of an argument should be displayed in the help text or not. Defaults to `false` (i.e. show possible values)",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"hide_default_value","","Specifies if the default value of an argument should be displayed in the help text or not. Defaults to `false` (i.e. show default value)",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"index","","Specifies the index of a positional argument starting at 1.",7,{"i":[{"n":"self"},{"n":"u64"}],"o":{"n":"arg"}}],[11,"multiple","","Specifies that the argument may appear more than once. For flags, this results in the number of occurrences of the flag being recorded. For example `-ddd` or `-d -d -d` would count as three occurrences. For options there is a distinct difference in multiple occurrences vs multiple values.",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"value_terminator","","Specifies a value that stops parsing multiple values of a give argument. By default when one sets [`multiple(true)`] on an argument, clap will continue parsing values for that argument until it reaches another valid argument, or one of the other more specific settings for multiple values is used (such as [`min_values`], [`max_values`] or [`number_of_values`]).",7,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"arg"}}],[11,"global","","Specifies that an argument can be matched to all child [`SubCommand`]s.",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"empty_values","","Allows an argument to accept explicitly empty values. An empty value must be specified at the command line with an explicit `\"\"`, or `''`",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"hidden","","Hides an argument from help message output.",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"possible_values","","Specifies a list of possible values for this argument. At runtime, `clap` verifies that only one of the specified values was used, or fails with an error message.",7,null],[11,"possible_value","","Specifies a possible value for this argument, one at a time. At runtime, `clap` verifies that only one of the specified values was used, or fails with error message.",7,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"arg"}}],[11,"case_insensitive","","When used with [`Arg::possible_values`] it allows the argument value to pass validation even if the case differs from that of the specified `possible_value`.",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"group","","Specifies the name of the [`ArgGroup`] the argument belongs to.",7,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"arg"}}],[11,"groups","","Specifies the names of multiple [`ArgGroup`]'s the argument belongs to.",7,null],[11,"number_of_values","","Specifies how many values are required to satisfy this argument. For example, if you had a `-f <file>` argument where you wanted exactly 3 'files' you would set `.number_of_values(3)`, and this argument wouldn't be satisfied unless the user provided 3 and only 3 values.",7,{"i":[{"n":"self"},{"n":"u64"}],"o":{"n":"arg"}}],[11,"validator","","Allows one to perform a custom validation on the argument value. You provide a closure which accepts a [`String`] value, and return a [`Result`] where the [`Err(String)`] is a message displayed to the user.",7,{"i":[{"n":"self"},{"n":"f"}],"o":{"n":"arg"}}],[11,"validator_os","","Works identically to Validator but is intended to be used with values that could contain non UTF-8 formatted strings.",7,{"i":[{"n":"self"},{"n":"f"}],"o":{"n":"arg"}}],[11,"max_values","","Specifies the maximum number of values are for this argument. For example, if you had a `-f <file>` argument where you wanted up to 3 'files' you would set `.max_values(3)`, and this argument would be satisfied if the user provided, 1, 2, or 3 values.",7,{"i":[{"n":"self"},{"n":"u64"}],"o":{"n":"arg"}}],[11,"min_values","","Specifies the minimum number of values for this argument. For example, if you had a `-f <file>` argument where you wanted at least 2 'files' you would set `.min_values(2)`, and this argument would be satisfied if the user provided, 2 or more values.",7,{"i":[{"n":"self"},{"n":"u64"}],"o":{"n":"arg"}}],[11,"use_delimiter","","Specifies whether or not an argument should allow grouping of multiple values via a delimiter. I.e. should `--option=val1,val2,val3` be parsed as three values (`val1`, `val2`, and `val3`) or as a single value (`val1,val2,val3`). Defaults to using `,` (comma) as the value delimiter for all arguments that accept values (options and positional arguments)",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"require_delimiter","","Specifies that multiple values may only be set using the delimiter. This means if an if an option is encountered, and no delimiter is found, it automatically assumed that no additional values for that option follow. This is unlike the default, where it is generally assumed that more values will follow regardless of whether or not a delimiter is used.",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"value_delimiter","","Specifies the separator to use when values are clumped together, defaults to `,` (comma).",7,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"arg"}}],[11,"value_names","","Specify multiple names for values of option arguments. These names are cosmetic only, used for help and usage strings only. The names are not used to access arguments. The values of the arguments are accessed in numeric order (i.e. if you specify two names `one` and `two` `one` will be the first matched value, `two` will be the second).",7,null],[11,"value_name","","Specifies the name for value of [option] or [positional] arguments inside of help documentation. This name is cosmetic only, the name is not used to access arguments. This setting can be very helpful when describing the type of input the user should be using, such as `FILE`, `INTERFACE`, etc. Although not required, it's somewhat convention to use all capital letters for the value name.",7,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"arg"}}],[11,"default_value","","Specifies the value of the argument when not specified at runtime.",7,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"arg"}}],[11,"default_value_os","","Provides a default value in the exact same manner as [`Arg::default_value`] only using [`OsStr`]s instead. [`Arg::default_value`]: ./struct.Arg.html#method.default_value [`OsStr`]: https://doc.rust-lang.org/std/ffi/struct.OsStr.html",7,{"i":[{"n":"self"},{"n":"osstr"}],"o":{"n":"arg"}}],[11,"default_value_if","","Specifies the value of the argument if `arg` has been used at runtime. If `val` is set to `None`, `arg` only needs to be present. If `val` is set to `\"some-val\"` then `arg` must be present at runtime and have the value `val`.",7,{"i":[{"n":"self"},{"n":"str"},{"g":["str"],"n":"option"},{"n":"str"}],"o":{"n":"arg"}}],[11,"default_value_if_os","","Provides a conditional default value in the exact same manner as [`Arg::default_value_if`] only using [`OsStr`]s instead. [`Arg::default_value_if`]: ./struct.Arg.html#method.default_value_if [`OsStr`]: https://doc.rust-lang.org/std/ffi/struct.OsStr.html",7,{"i":[{"n":"self"},{"n":"str"},{"g":["osstr"],"n":"option"},{"n":"osstr"}],"o":{"n":"arg"}}],[11,"default_value_ifs","","Specifies multiple values and conditions in the same manner as [`Arg::default_value_if`]. The method takes a slice of tuples in the `(arg, Option<val>, default)` format.",7,null],[11,"default_value_ifs_os","","Provides multiple conditional default values in the exact same manner as [`Arg::default_value_ifs`] only using [`OsStr`]s instead. [`Arg::default_value_ifs`]: ./struct.Arg.html#method.default_value_ifs [`OsStr`]: https://doc.rust-lang.org/std/ffi/struct.OsStr.html",7,null],[11,"env","","Specifies that if the value is not passed in as an argument, that it should be retrieved from the environment, if available. If it is not present in the environment, then default rules will apply.",7,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"arg"}}],[11,"env_os","","Specifies that if the value is not passed in as an argument, that it should be retrieved from the environment if available in the exact same manner as [`Arg::env`] only using [`OsStr`]s instead.",7,{"i":[{"n":"self"},{"n":"osstr"}],"o":{"n":"arg"}}],[11,"hide_env_values","","@TODO @p2 @docs @release: write docs",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"next_line_help","","When set to `true` the help string will be displayed on the line after the argument and indented once. This can be helpful for arguments with very long or complex help messages. This can also be helpful for arguments with very long flag names, or many/long value names.",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"display_order","","Allows custom ordering of args within the help message. Args with a lower value will be displayed first in the help message. This is helpful when one would like to emphasise frequently used args, or prioritize those towards the top of the list. Duplicate values are allowed. Args with duplicate display orders will be displayed in alphabetical order.",7,{"i":[{"n":"self"},{"n":"usize"}],"o":{"n":"arg"}}],[11,"raw","","Indicates that all parameters passed after this should not be parsed individually, but rather passed in their entirety. It is worth noting that setting this requires all values to come after a `--` to indicate they should all be captured. For example:",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"hidden_short_help","","Hides an argument from short help message output.",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"hidden_long_help","","Hides an argument from long help message output.",7,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arg"}}],[11,"is_set","","Checks if one of the [`ArgSettings`] settings is set for the argument [`ArgSettings`]: ./enum.ArgSettings.html",7,{"i":[{"n":"self"},{"n":"argsettings"}],"o":{"n":"bool"}}],[11,"set","","Sets one of the [`ArgSettings`] settings for the argument [`ArgSettings`]: ./enum.ArgSettings.html",7,{"i":[{"n":"self"},{"n":"argsettings"}],"o":{"n":"arg"}}],[11,"unset","","Unsets one of the [`ArgSettings`] settings for the argument [`ArgSettings`]: ./enum.ArgSettings.html",7,{"i":[{"n":"self"},{"n":"argsettings"}],"o":{"n":"arg"}}],[11,"value_of","","Gets the value of a specific [option] or [positional] argument (i.e. an argument that takes an additional value at runtime). If the option wasn't present at runtime it returns `None`.",12,{"i":[{"n":"self"},{"n":"s"}],"o":{"g":["str"],"n":"option"}}],[11,"value_of_lossy","","Gets the lossy value of a specific argument. If the argument wasn't present at runtime it returns `None`. A lossy value is one which contains invalid UTF-8 code points, those invalid points will be replaced with `\\u{FFFD}`",12,{"i":[{"n":"self"},{"n":"s"}],"o":{"g":["cow"],"n":"option"}}],[11,"value_of_os","","Gets the OS version of a string value of a specific argument. If the option wasn't present at runtime it returns `None`. An OS value on Unix-like systems is any series of bytes, regardless of whether or not they contain valid UTF-8 code points. Since [`String`]s in Rust are guaranteed to be valid UTF-8, a valid filename on a Unix system as an argument value may contain invalid UTF-8 code points.",12,{"i":[{"n":"self"},{"n":"s"}],"o":{"g":["osstr"],"n":"option"}}],[11,"values_of","","Gets a [`Values`] struct which implements [`Iterator`] for values of a specific argument (i.e. an argument that takes multiple values at runtime). If the option wasn't present at runtime it returns `None`",12,{"i":[{"n":"self"},{"n":"s"}],"o":{"g":["values"],"n":"option"}}],[11,"values_of_lossy","","Gets the lossy values of a specific argument. If the option wasn't present at runtime it returns `None`. A lossy value is one where if it contains invalid UTF-8 code points, those invalid points will be replaced with `\\u{FFFD}`",12,{"i":[{"n":"self"},{"n":"s"}],"o":{"g":["vec"],"n":"option"}}],[11,"values_of_os","","Gets a [`OsValues`] struct which is implements [`Iterator`] for [`OsString`] values of a specific argument. If the option wasn't present at runtime it returns `None`. An OS value on Unix-like systems is any series of bytes, regardless of whether or not they contain valid UTF-8 code points. Since [`String`]s in Rust are guaranteed to be valid UTF-8, a valid filename as an argument value on Linux (for example) may contain invalid UTF-8 code points.",12,{"i":[{"n":"self"},{"n":"s"}],"o":{"g":["osvalues"],"n":"option"}}],[11,"is_present","","Returns `true` if an argument was present at runtime, otherwise `false`.",12,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"bool"}}],[11,"occurrences_of","","Returns the number of times an argument was used at runtime. If an argument isn't present it will return `0`.",12,{"i":[{"n":"self"},{"n":"s"}],"o":{"n":"u64"}}],[11,"index_of","","Gets the starting index of the argument in respect to all other arguments. Indices are similar to argv indices, but are not exactly 1:1.",12,{"i":[{"n":"self"},{"n":"s"}],"o":{"g":["usize"],"n":"option"}}],[11,"indices_of","","Gets all indices of the argument in respect to all other arguments. Indices are similar to argv indices, but are not exactly 1:1.",12,{"i":[{"n":"self"},{"n":"s"}],"o":{"g":["indices"],"n":"option"}}],[11,"subcommand_matches","","Because [`Subcommand`]s are essentially \"sub-[`App`]s\" they have their own [`ArgMatches`] as well. This method returns the [`ArgMatches`] for a particular subcommand or `None` if the subcommand wasn't present at runtime.",12,{"i":[{"n":"self"},{"n":"s"}],"o":{"g":["argmatches"],"n":"option"}}],[11,"subcommand_name","","Because [`Subcommand`]s are essentially \"sub-[`App`]s\" they have their own [`ArgMatches`] as well.But simply getting the sub-[`ArgMatches`] doesn't help much if we don't also know which subcommand was actually used. This method returns the name of the subcommand that was used at runtime, or `None` if one wasn't.",12,{"i":[{"n":"self"}],"o":{"g":["str"],"n":"option"}}],[11,"subcommand","","This brings together [`ArgMatches::subcommand_matches`] and [`ArgMatches::subcommand_name`] by returning a tuple with both pieces of information.",12,null],[11,"usage","","Returns a string slice of the usage statement for the [`App`] or [`SubCommand`]",12,{"i":[{"n":"self"}],"o":{"n":"str"}}],[11,"with_name","","Creates a new instance of `ArgGroup` using a unique string name. The name will be used to get values from the group or refer to the group inside of conflict and requirement rules.",8,{"i":[{"n":"str"}],"o":{"n":"arggroup"}}],[11,"arg","","Adds an [argument] to this group by name",8,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"arggroup"}}],[11,"args","","Adds multiple [arguments] to this group by name",8,null],[11,"multiple","","Allows more than one of the ['Arg']s in this group to be used. (Default: `false`)",8,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arggroup"}}],[11,"required","","Sets the group as required or not. A required group will be displayed in the usage string of the application in the format `<arg|arg2|arg3>`. A required `ArgGroup` simply states that one argument from this group must be present at runtime (unless conflicting with another argument).",8,{"i":[{"n":"self"},{"n":"bool"}],"o":{"n":"arggroup"}}],[11,"requires","","Sets the requirement rules of this group. This is not to be confused with a [required group]. Requirement rules function just like [argument requirement rules], you can name other arguments or groups that must be present when any one of the arguments from this group is used.",8,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"arggroup"}}],[11,"requires_all","","Sets the requirement rules of this group. This is not to be confused with a [required group]. Requirement rules function just like [argument requirement rules], you can name other arguments or groups that must be present when one of the arguments from this group is used.",8,null],[11,"conflicts_with","","Sets the exclusion rules of this group. Exclusion (aka conflict) rules function just like [argument exclusion rules], you can name other arguments or groups that must not be present when one of the arguments from this group are used.",8,{"i":[{"n":"self"},{"n":"str"}],"o":{"n":"arggroup"}}],[11,"conflicts_with_all","","Sets the exclusion rules of this group. Exclusion rules function just like [argument exclusion rules], you can name other arguments or groups that must not be present when one of the arguments from this group are used.",8,null],[11,"use_stderr","","Should the message be written to `stdout` or not",3,{"i":[{"n":"self"}],"o":{"n":"bool"}}],[11,"exit","","Prints the error to `stderr` and exits with a status of `1`",3,null],[11,"with_description","","Create an error with a custom description.",3,{"i":[{"n":"str"},{"n":"errorkind"}],"o":{"n":"error"}}],[11,"with_name","","Creates a new instance of a subcommand requiring a name. The name will be displayed to the user when they print version or help and usage information.",11,{"i":[{"n":"str"}],"o":{"n":"app"}}],[11,"variants","","A list of possible variants in `&'static str` form",4,null]],"paths":[[4,"ArgSettings"],[4,"ErrorKind"],[4,"AppSettings"],[3,"Error"],[4,"Shell"],[8,"StructOpt"],[3,"App"],[3,"Arg"],[3,"ArgGroup"],[3,"OsValues"],[3,"Values"],[3,"SubCommand"],[3,"ArgMatches"]]};
